import logo from './logo.svg';
import './App.css';
import { MyNavBar } from './components/Navbar';
import { MyBanner } from './components/Banner'
import 'bootstrap/dist/css/bootstrap.min.css';

function App() {
  return (
    <div className="App">
      <MyNavBar />
      <MyBanner />
    </div>
  );
}

export default App;
